        let list;

        if(this.props.books) {
            list = <ol>{this.props.books.map((book)=> <li key={book.name}>{book.name} {book.author} </li>)} 

            </ol>
        }
        else {
            list=<p>Brak książek</p>
        }
        return (


            <div>
                <div className="card">
                <div>{list}</div>

                </div>
                </div>
        )}
}
